import { Routes } from 'react-router-dom';
import './App.css';
import FeatureList from './components/FeatureList';
import Navbar from './components/Navbar';

function App() {
  return (
    <>
    <Routes>
      <Route path="/"></Route>
    </Routes>
      <Navbar/>
      <FeatureList/>
    </>
  );
}

export default App;
